import { Link } from "react-router-dom";
import BottomBar from "../components/navbar/BottomBar";
import { useState, useEffect } from 'react';

const LandingPage = () => {
  const [currentSection, setCurrentSection] = useState(0);

  useEffect(() => {
    const handleScroll = () => {
      const sections = document.querySelectorAll('.landing-section');
      let currentIndex = 0;
      let maxScrollY = 0;

      sections.forEach((section, index) => {
        const sectionTop = section.offsetTop;
        const sectionHeight = section.offsetHeight;

        if (window.scrollY >= sectionTop - sectionHeight / 2) {
          currentIndex = index;
          maxScrollY = sectionTop + sectionHeight - window.innerHeight;
        }
      });

      setCurrentSection(currentIndex);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <div className="relative h-screen overflow-hidden">
      {/* Hero Section */}
      <div className="landing-section absolute top-0 left-0 w-full h-full z-0">
        <div className="absolute top-0 left-0 w-full h-full bg-gradient-to-r from-indigo-600 to-purple-600 opacity-50"></div>
        <div className="absolute top-0 left-0 w-full h-full bg-cover bg-center bg-no-repeat animate-scroll-left" style={{ backgroundImage: 'url("/bus1.jpg")' }}></div>
        <div className="absolute top-0 left-0 w-full h-full bg-cover bg-center bg-no-repeat animate-scroll-right" style={{ backgroundImage: 'url("/bus2.jpg")' }}></div>
        <div className="absolute top-0 left-0 w-full h-full bg-cover bg-center bg-no-repeat animate-scroll-left" style={{ backgroundImage: 'url("/bus3.jpg")' }}></div>

        <div className="relative z-10 flex items-center justify-center h-full">
          <div className="max-w-lg w-full bg-white bg-opacity-70 backdrop-filter backdrop-blur-lg drop-shadow-lg rounded-md py-20 px-4 text-center">
            <h2 className="font-extrabold text-3xl text-gray-800">Welcome to FatafAT yAtra</h2>
            <p className="text-gray-600 mt-4">
              Book your tickets with ease and enjoy your journey.
            </p>
            <div className="w-full text-center pt-10">
              <Link
                to="/book-now"
                className="py-3 px-8 rounded-md bg-indigo-600 text-white font-bold hover:bg-indigo-700 transition-colors duration-300"
              >
                Book Now
              </Link>
            </div>
          </div>
        </div>
      </div>

      {/* Features Section */}
      <div className="landing-section absolute top-full left-0 w-full h-full z-0">
        <div className="absolute top-0 left-0 w-full h-full bg-gradient-to-r from-indigo-600 to-purple-600 opacity-50"></div>
        <div className="absolute top-0 left-0 w-full h-full bg-cover bg-center bg-no-repeat animate-scroll-right" style={{ backgroundImage: 'url("/bus4.jpg")' }}></div>
        <div className="absolute top-0 left-0 w-full h-full bg-cover bg-center bg-no-repeat animate-scroll-left" style={{ backgroundImage: 'url("/bus5.jpg")' }}></div>
        <div className="relative z-10 flex items-center justify-center h-full">
          <div className="max-w-lg w-full bg-white bg-opacity-70 backdrop-filter backdrop-blur-lg drop-shadow-lg rounded-md py-20 px-4 text-center">
            <h2 className="font-extrabold text-3xl text-gray-800">Features</h2>
            <ul className="text-gray-600 mt-4 text-left">
              <li className="py-2">✓ Easy booking process</li>
              <li className="py-2">✓ Real-time seat availability</li>
              <li className="py-2">✓ Flexible cancellation and refund policies</li>
              <li className="py-2">✓ 24/7 customer support</li>
            </ul>
          </div>
        </div>
      </div>

      {/* Pricing Section */}
      <div className="landing-section absolute top-[200%] left-0 w-full h-full z-0">
        <div className="absolute top-0 left-0 w-full h-full bg-gradient-to-r from-indigo-600 to-purple-600 opacity-50"></div>
        <div className="absolute top-0 left-0 w-full h-full bg-cover bg-center bg-no-repeat animate-scroll-left" style={{ backgroundImage: 'url("/bus6.jpg")' }}></div>
        <div className="absolute top-0 left-0 w-full h-full bg-cover bg-center bg-no-repeat animate-scroll-right" style={{ backgroundImage: 'url("/bus7.jpg")' }}></div>
        <div className="relative z-10 flex items-center justify-center h-full">
          <div className="max-w-lg w-full bg-white bg-opacity-70 backdrop-filter backdrop-blur-lg drop-shadow-lg rounded-md py-20 px-4 text-center">
            <h2 className="font-extrabold text-3xl text-gray-800">Pricing</h2>
            <p className="text-gray-600 mt-4">
              Our bus tickets are affordable and tailored to your needs.
            </p>
            <div className="w-full text-center pt-10">
              <Link
                to="/pricing"
                className="py-3 px-8 rounded-md bg-indigo-600 text-white font-bold hover:bg-indigo-700 transition-colors duration-300"
              >
                View Pricing
              </Link>
            </div>
          </div>
        </div>
      </div>

      {/* Booking Invitation Page */}
      <div className="absolute bottom-0 left-0 w-full bg-white bg-opacity-70 backdrop-filter backdrop-blur-lg drop-shadow-lg rounded-md py-10 px-4 text-center">
        <h3 className="font-bold text-2xl text-gray-800">Book your bus tickets now</h3>
        <p className="text-gray-600 mt-2">
          Explore our wide range of bus routes and book your tickets with ease.
        </p>
        <div className="w-full text-center pt-6">
          <Link
            to="/book-now"
            className="py-3 px-8 rounded-md bg-indigo-600 text-white font-bold hover:bg-indigo-700 transition-colors duration-300"
          >
            Book Now
          </Link>
        </div>
      </div>

      {/* Bottom Navbar */}
      <BottomBar />
    </div>
  );
};

export default LandingPage;
